#林俊杰晒照感谢胡彦斌# “音乐的路上能够有相惜的” 林俊杰晒照感谢胡彦斌~真的有感受到音乐人的惺惺相惜！ 一起在音乐的道路上越走越远~ 虽然但是，能不能让我抢到你两的票啊！
在苏州跟大家一起同庆21年来的点滴 我要JJ20实实在在地属于你和我！ 感谢才子 @胡彦斌 抽空来 音乐的路上能够有相惜的 JJ20 苏州站 Day 2 见！ #林俊杰jj20世界巡回演唱会# #jj20andbeyond# #在林俊杰演唱会重拾快乐#
@林俊杰 昨天和 @胡彦斌 的talking  胡：很高兴可以在JJ的演唱会上见到大家，我其实跟你们一样我在知道他来苏州开演唱会的时候，我给他发短信，我说，你的票买不到，我说我能不能来看啊，然后JJ就邀请我到舞台上，我非常非常的激动  林：我说你何止来看，你要来唱啊  胡：然后我记得我们上一次一起唱歌 ... 全文
